// https://en.wikipedia.org/wiki/Xterm

// https://jonasjacek.github.io/colors/data.json

var B64ENCODED_XTERM_COLORS = '';

var XTERM_COLORS = eval(atob(B64ENCODED_XTERM_COLORS));
var HEX_COLOR_BLACK = '#000';
var DEFAULT_ANSI_COLOR_CODE = 7; // @w

var XTERM_ANSI_COLORS_MAP = {
    ' ' : 0, 'r' : 1, 'g' :  2, 'y' :  3, 'b' :  4, 'm' :  5, 'c' :  6, 'w' : 7,
    'D' : 8, 'R' : 9, 'G' : 10, 'Y' : 11, 'B' : 12, 'M' : 13, 'C' : 14, 'W' : 15
};


function getXtermColor(colorIntCode) {
    var color = null;
    if (colorIntCode >= 0 && colorIntCode <= 255) {
        color = XTERM_COLORS[colorIntCode];
    }
    return color;
}

function getHexColorCode(xtermColorCode) {
    if (typeof(xtermColorCode) === 'string' && xtermColorCode.startsWith('x')) {
        xtermColorCode = xtermColorCode.substr(1);
    }

    var colorIntCode = parseInt(xtermColorCode) || XTERM_ANSI_COLORS_MAP[xtermColorCode] || DEFAULT_ANSI_COLOR_CODE;
    var xtermColor = getXtermColor(colorIntCode);
    var hexColorCode = xtermColor.hexString;

    return hexColorCode;
}

document.addEventListener('DOMContentLoaded', function() {
    // converts one single line of Xterm text to HTML
    function xterm2Html(line) {
        var wrapLine = function(hexColorCode, coloredPhrase) {
            var html = '<span style="background-color: ' + HEX_COLOR_BLACK + '; color: ' + hexColorCode + ';">' + coloredPhrase + '</span>';
            return html;
        };

        var regex = /@((?:[bBrRgGyYcCmMwWD])|(?:x\d{1,3}))([^@]*)/g;

        var htmlLine;

        if (regex.test(line)) {
            htmlLine = line.replace(regex, function(text, xtermColorCode, coloredPhrase) {
                var hexColorCode = getHexColorCode(xtermColorCode);
                var html = wrapLine(hexColorCode, coloredPhrase);
                return html;
            });
        } else {
            // no color codes detected on this line
            var hexColorCode = getHexColorCode(DEFAULT_ANSI_COLOR_CODE);
            htmlLine = wrapLine(hexColorCode, line);
        }

        return htmlLine;
    }

    // converts one HTML `<code class="xterm">...</code>` widget to Xterm-colorized output
    function formatXtermWidget(elt) {
        var text = elt.innerHTML;
        var lines = text.split('\n');

        var htmlLines = [];

        for (var i=0; i < lines.length; ++i) {
            var line = lines[i];
            line = line.replace(/ /g, '&nbsp;');
            var htmlLine = xterm2Html(line);
            htmlLines.push(htmlLine);
        }

        var html = htmlLines.join('<br/>');
        elt.innerHTML = html;
    }

    // entry point. convert all `<code class="xterm">...</code>` widgets on page
    function formatXtermWidgets() {
        var selectors = [
            'code.xterm',
            'code.language-xterm'
        ];

        for (var i=0; i < selectors.length; ++i) {
            var selector = selectors[i];
            var widgets = document.querySelectorAll(selector);

            for (var j=0; j < widgets.length; ++j) {
                var widget = widgets[j];
                formatXtermWidget(widget);
            }

        }
    }

    function exports() {
        window.formatXtermWidgets = formatXtermWidgets;
    }

    function init() {
        formatXtermWidgets();

    }

    exports();
    init();
});
